import React, { Component } from 'react';
import cycle from './cycle.jpg';
import shop3 from './shop3.jpg';

export default class Image extends Component {
    render() {
        return (
            <div>
            <img src={this.props.cycle}/>
                
            </div>
        )
    }
}
